queries.query:
query moves{
  moves: pokemon_v2_move {
    name
    accuracy
    id
    power
    pp
    priority
    type: pokemon_v2_type {
      name
    }
    damage_class: pokemon_v2_movedamageclass {
      name
    }
  }
}

query moves($moveId: Int) {
  moves: pokemon_v2_move(where: {id: {_eq: $moveId}}) {
    name
    accuracy
    id
    power
    pp
    priority
    type: pokemon_v2_type {
      name
    }
    damage_class: pokemon_v2_movedamageclass {
      name
    }
  }
}

query pokemon($id: Int) {
  pokemon: pokemon_v2_pokemon(where: {id: {_eq: $id}}) {
    name
    id
    formAbout: pokemon_v2_pokemonforms {
      form_name
      is_battle_only
      is_mega
    }
    moves: pokemon_v2_pokemonmoves(distinct_on: move_id, order_by: {move_id: asc}) {
      move: pokemon_v2_move {
        id
      }
    }
    legend: pokemon_v2_pokemonspecy {
      is_mythical
      is_legendary
    }
    stats: pokemon_v2_pokemonstats {
      stat: pokemon_v2_stat {
        name
      }
      base_stat
    }
    types: pokemon_v2_pokemontypes {
      type: pokemon_v2_type {
        name
      }
    }
  }
}

